"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Aspiration pneumonia (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/aspiration-pneumonia-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H5551156\">",
"      <span class=\"h1\">",
"       What is aspiration pneumonia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Aspiration pneumonia is when a substance that should not be in the lungs gets into the lungs and causes problems (",
"      <a class=\"graphic graphic_figure graphicRef67527 \" href=\"UTD.htm?40/17/41237\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      Normally, the body can keep foods, liquids, bacteria, and other things out of the lungs and airways (the tubes that carry air inside the lungs). But if the body accidentally lets these things into the lungs, they can do 1 or more of the following:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Damage the lung tissue",
"       </li>",
"       <li>",
"        Cause an infection (called &ldquo;pneumonia&rdquo;)",
"       </li>",
"       <li>",
"        Block an airway",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Some people are more likely to get aspiration pneumonia, such as those who:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Are sleepy from surgery or have passed out from alcohol or drugs",
"       </li>",
"       <li>",
"        Have problems with swallowing, such as from a stroke or brain damage",
"       </li>",
"       <li>",
"        Have certain conditions affecting their stomach or esophagus (the tube from the mouth to the stomach)",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5551171\">",
"      <span class=\"h1\">",
"       What are the symptoms of aspiration pneumonia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Symptoms depend partly what&rsquo;s causing the aspiration pneumonia. They can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        A fever",
"       </li>",
"       <li>",
"        A cough &ndash; People might cough up mucus that smells bad, or is green or bloody.",
"       </li>",
"       <li>",
"        Trouble breathing or catching your breath",
"       </li>",
"       <li>",
"        Noisy breathing (wheezing)",
"       </li>",
"       <li>",
"        Bluish-looking skin",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5551186\">",
"      <span class=\"h1\">",
"       Should I call my doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Call your doctor or nurse if you have the symptoms listed above, especially if they started after you choked on food or drink.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5551201\">",
"      <span class=\"h1\">",
"       Will I need tests?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Probably. Your doctor or nurse will ask about your symptoms and do an exam. To look for a problem in your lungs, he or she might do 1 or more of the following tests:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        A chest x-ray",
"       </li>",
"       <li>",
"        A CT scan of your chest &ndash; This is an imaging test that can create pictures of the inside of your body.",
"       </li>",
"       <li>",
"        Lab tests &ndash; These can include blood tests or tests on a sample of the mucus you cough up.",
"       </li>",
"       <li>",
"        Bronchoscopy &ndash; This is a procedure in which a doctor puts a thin tube with a camera on the end (called a &ldquo;bronchoscope&rdquo;) in your mouth and down into your airways. Then he or she can look inside your airways and lungs.",
"       </li>",
"       <li>",
"        Tests to check for swallowing problems",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5551218\">",
"      <span class=\"h1\">",
"       How is aspiration pneumonia treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Treatment depends on your symptoms and what&rsquo;s causing your aspiration pneumonia. Most people need to be treated in the hospital, at least at first.",
"     </p>",
"     <p>",
"      If you have an infection, your doctor will treat it with antibiotic medicines. These medicines usually go into your vein through a tube called an &ldquo;IV.&rdquo; The antibiotic your doctor chooses depends on the kind of bacteria causing your infection.",
"     </p>",
"     <p>",
"      If an object is blocking your airway, your doctor can try to remove the object during bronchoscopy.",
"     </p>",
"     <p>",
"      If a harmful substance damaged your lungs, your doctor can use a suction device to suck out liquid from your lungs.",
"     </p>",
"     <p>",
"      Some people with aspiration pneumonia need extra oxygen. Your doctor will give you extra oxygen if you are not getting enough oxygen when you breathe normally.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5551233\">",
"      <span class=\"h1\">",
"       Can aspiration pneumonia be prevented?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Sometimes. Some people with long-term swallowing problems can help prevent aspiration pneumonia by changing what and how they eat and drink. If your doctor recommends making these changes, he or she will have you work with a speech therapist or a dietitian (food expert).",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5551248\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?35/18/36130?source=see_link\">",
