"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?42/0/43011?source=see_link\">",
"       Patient information: Cough in adults (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?13/7/13427?source=see_link\">",
"       Patient information: Cough in children (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?21/43/22195?source=see_link\">",
