"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?29/38/30308?source=see_link\">",
"       Patient information: Pneumonia in adults (Beyond the Basics)",
"      </a>",
"     </p>",
