var title_f13_34_13869="Causes of delayed passage of meconium";
var content_f13_34_13869=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F82181%7EPEDS%2F70206%7EPEDS%2F61392&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F82181%7EPEDS%2F70206%7EPEDS%2F61392&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Diagnoses to consider in infants and children with delayed passage of meconium",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Condition",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comments",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hirschsprung disease",
"       </td>",
"       <td>",
"        Abdominal distension and vomiting are common. On digital examination, the rectal vault may be empty. On contrast enema, a transition zone may be seen, but often is not visible in newborns.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Intestinal obstruction",
"       </td>",
"       <td>",
"        Consider atresia, webs or volvulus. Obstruction may be present even in infants who pass meconium.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Meconium ileus",
"       </td>",
"       <td>",
"        Symptoms often begin on second day of life. Most patients with meconium ileus have cystic fibrosis.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Functional ileus",
"       </td>",
"       <td>",
"        Occurs in setting of prematurity, sepsis, respiratory distress, pneumonia, or electrolyte disturbances.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Small left colon*",
"       </td>",
"       <td>",
"        Barium enema shows small-caliber left colon. Increased incidence with maternal diabetes.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Drugs administered to mother before delivery",
"       </td>",
"       <td>",
"        Magnesium sulfate (MgSO4), opiates, or ganglionic blocking agents.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hypothyroidism",
"       </td>",
"       <td>",
"        Infants with hypothyroidism also may have prolonged jaundice, lethargy, and low body temperature.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Similar findings may occur in infants with Hirschsprung disease (HD), so affected infants should be observed closely and evaluated for HD if appropriate.",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Tunnessen WJ. Constipation and fecal retention. In: Signs and Symptoms in Pediatrics, 3rd ed, Lippincott, Williams &amp; Wilkins, Philadelphia 1999. p.518.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Endocrine and metabolic causes of constipation in infants and children",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Hypokalemia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hypo- or hypercalcemia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hypothyroidism",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Diabetes mellitus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pheochromocytoma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Polyuria (leading to dehydration)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Amyloidosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Acute intermittent porphyria",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Tunnessen WJ. Constipation and fecal retention. In: Signs and Symptoms in Pediatrics, 3rd ed, Lippincott, Williams &amp; Wilkins, Philadelphia 1999. p.518.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Neurogenic causes of constipation in infants and children",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Cerebral palsy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Myelomeningocele",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Spinal cord injury",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Sacral agenesis*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Split spinal cord malformation (diastematomyelia)*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Spinal dysraphism (several types; sometimes associated with cutaneous anomalies overlying the dysraphic segment, and/or with tethered cord syndrome)*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Neurofibromatosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Muscular weakness",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Guillaine-Barre' syndrome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Neuronal dysplasia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Familial dysautonomia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Acquired postganglionic cholinergic dysautonomia",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Refer to UpToDate topic review on Spinal dysraphism.",
"    </div>",
"    <div class=\"reference\">",
"     Data from Tunnessen WJ. Constipation and fecal retention. In: Signs and Symptoms in Pediatrics, 3rd edition, Lippincott, Williams &amp;Wilkins, Philadelphia 1999. p.518.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
